import React from 'react';

function regButt() {
  const handleClick = () => {
    alert('Button was clicked!');
  };

  return (
    <form onSubmit={handleClick}>
        <div>

        <button 
        onClick={handleClick}
        type="button">
        Click
        </button>

        </div>

    </form>
    
        
    
  );
}

export default regButt;
